import React from "react";
import axios from "axios";

const ALL_USERS_GET_API_URL =
  "http://localhost:8084/dts/admin/users/adminTempSpace/adminTempEmail";

class UserService {
  getAllUsers() {
    axios.get(ALL_USERS_GET_API_URL);
  }
}

export default new UserService();
